            phone_number: "789789"
        }
    ]);

    useEffect(() => {
        console.log(contacts);
    }, [contacts]);
    return <div id="container">
        <h1>Contacts</h1>
        < List contacts={contacts} />
        < Form addContacts={setContacts} contacts={contacts} />
    </div>

}

